import React from 'react';
import WeekInfoCardComponents from './WeekInfoCard';
import ChooseStateComponents from './ChooseState';
import HumidityComponents from './HUMIDITY';
import LeftComponents from './Left';

const HomeComponents = () => {
    return (
        <>
            <div className='homeWrap'>
                <div id="mySidenav" class="sidenav">
                    <NavMenu>
                        <NavLink to='/about' activeStyle>
                            About
                        </NavLink>
                        <NavLink to='/events' activeStyle>
                            Events
                        </NavLink>
                        <NavLink to='/annual' activeStyle>
                            Annual Report
                        </NavLink>
                        <NavLink to='/team' activeStyle>
                            Teams
                        </NavLink>
                        <NavLink to='/blogs' activeStyle>
                            Blogs
                        </NavLink>
                        <NavLink to='/sign-up' activeStyle>
                            Sign Up
                        </NavLink>
                        {/* Second Nav */}
                        {/* <NavBtnLink to='/sign-in'>Sign In</NavBtnLink> */}
                    </NavMenu>
                    <p class="logo">Weather Prediction</p>
                    <a href="/" class="icon-a">&nbsp;&nbsp;About Us</a>
                    <a href="/" class="icon-a"> &nbsp;&nbsp;Developer</a>
                    <a href="/" class="icon-a">&nbsp;&nbsp;Weather Prediction</a>
                </div>
                <div className='weatherSection'>
                    <LeftComponents />
                    <div className='rightSide'>
                        <ChooseStateComponents />
                        <WeekInfoCardComponents />
                        <HumidityComponents />
                    </div>
                </div>
            </div>
        </>
    )
}

export default HomeComponents;


